import React from 'react'
import { Contenedor } from "../../Components";
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import { makeStyles } from '@material-ui/core/styles'
import { TextField } from '@mui/material';


const useStyles = makeStyles (theme=>({

    icons: {
        cursor: 'pointer'
    },
    inputMaterial:{
        width: '100%'
    },
    text:{
        fontFamily: 'oswald',
    },
    text2:{
        textAlign : 'left',
        marginLeft: '20px'
    },
    button:{
        width: '20%',
        //margin: theme.spacing(10,65,10),
        marginTop: theme.spacing(8) ,
        
        [theme.breakpoints.down(400 + theme.spacing(2)+2)]:{
            margin: theme.spacing(0),
            width: '100%',
            height: '100%'
        }
    },
    grid: {
        width: '100%',
        margin: '0px'
    }

}))

export default function SelectGanadores() {

    const classes = useStyles()
    return (
    
        <div>
            <Contenedor/>
            <div align = 'center'>
                <Box 
                        sx = {{flexGrow: 20}}
                        color = 'contrastText'
                        backgroundColor = '#D8F3DC'
                        mx = {20} //margen a todos los lados
                        p = {1} //padding
                        borderRadius = '8px'
                        border = {2}
                                
                >
                        <h1>Registrar Ganadores</h1>
                </Box>
                <br></br>
                <Box
                    sx = {{flexGrow: 20}}
                    color = 'contrastText'
                    backgroundColor = '#D8F3DC'
                    mx = {20} //margen a todos los lados
                    //p = {30} //padding
                    borderRadius = '8px'
                    border = {2}    
                >
                    <Grid container>
                        <Grid item sm = {3}>
                            <h2 className={classes.text2}>ID Campeonato:</h2>
                        </Grid>
                        <Grid item sm = {8} marginTop= {'10px'} marginRight = {'50px'} >
                            <TextField variant='outlined' fullWidth/>
                        </Grid>
                        

                    </Grid>
                    
                </Box>
            </div>


        </div>
    )
}
